import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import { Container } from "react-bootstrap";
import { Carousel } from "react-bootstrap";
import HomeCarousel from "./homeCarousel";
import "./homePage.css";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function HomePage() {
  return (
    <div className="componentContainer">
      <Container fluid>
        <Row>
          <Col>
            <HomeCarousel />
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="titleCard">StatsBull</Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="infoCard">
              This is the App's Home Page Component
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="noteCard">
              Add some cool react bootstrap components, photos, developer info..
            </Container>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default HomePage;
